  !> 
  !>     \f[
  !>         \begin{array}{cl}
  !>         A_j X_j = B_j & \: \text{not transposed,}\\
  !>         A_j^T X_j = B_j & \: \text{transposed, or}\\
  !>         A_j^H X_j = B_j & \: \text{conjugate transposed.}
