  !>     @param[in]
  !>     n           rocblas_int. n >= 0.\n
  !>                 The order of the system, i.e. the number of columns and rows of all A_j matrices.
  !>     @param[in]
  !>     nrhs        rocblas_int. nrhs >= 0.\n
