  !>         || B_i - A_i  X_i || \quad \text{(or} \: || B_i - A_i' X_i ||\text{)}
  !>     \f]
  !> 
  !>     If m < n (or m >= n in the case of transpose/conjugate transpose), the system is underdetermined
  !>     and a unique solution for X_i is chosen such that \f$|| X_i ||\f$ is minimal.
