  !> 
  !>     \f[
  !>         \begin{array}{cl}
  !>         Z^T B Z=I & \: \text{if 1st or 2nd form, or}\\
  !>         Z^T B^{-1} Z=I & \: \text{if 3rd form.}
  !>         \end{array}
  !>     \f]
  !> 
  !>     @param[in]
  !>     handle    rocblas_handle.
  !>     @param[in]
